"""Test finding paths from a list."""
up_nodes = {'MTMR4', 'ZFYVE1', 'MTMR14', 'MTMR3', 'WIPI1'}
edges = {('MTMR14', 'HMDB03850'), ('HMDB03850', 'ZFYVE1'), ('HMDB03850',
    'WIPI1'), ('MTMR4', 'HMDB03850'), ('MTMR3', 'HMDB03850')}
g = self.net_sub.paths_between_list(up_nodes, draw=False, save_name='ns_test')
ok_(set(g.edges()) == edges)
list_2 = {'CASP3', 'BAX', 'TP53'}
g = self.net_sub.paths_between_list(list_2, draw=False, single_path=False,
    save_name='smaller_list')
nodes = {'TP53', 'CASP3', 'CDKN1A', 'MAP3K1', 'BAX', 'MAPK10', 'MAPK8',
    'MAPK9', 'BCL2'}
ok_(set(g.nodes) == nodes)
